'use strict';

import React, { useCallback, useMemo, useRef, useState, StrictMode } from 'react';
import { createRoot } from 'react-dom/client';
import { AgGridReact } from '@ag-grid-community/react';
import '@ag-grid-community/styles/ag-grid.css';
import '@ag-grid-community/styles/ag-theme-quartz.css';
import './style.css';
import { ClientSideRowModelModule } from '@ag-grid-community/client-side-row-model';
import { ColDef, ColGroupDef, FirstDataRenderedEvent, GridApi, GridOptions, ModuleRegistry, createGrid } from '@ag-grid-community/core';
import { GridChartsModule } from '@ag-grid-enterprise/charts-enterprise';
import { MenuModule } from '@ag-grid-enterprise/menu';
import { RowGroupingModule } from '@ag-grid-enterprise/row-grouping';
import { generateData } from './data';
ModuleRegistry.registerModules([ClientSideRowModelModule, GridChartsModule, MenuModule, RowGroupingModule]);








const GridExample = () => {

    const containerStyle = useMemo(() => ({ width: '100%', height: '100%' }), []);
    const gridStyle = useMemo(() => ({height: '100%', width: '100%'}), []);
    const [rowData, setRowData] = useState<any[]>(generateData());
    const [columnDefs, setColumnDefs] = useState<ColDef[]>([
    { field: 'year', chartDataType: 'category' },
    { field: 'jan' },
    { field: 'feb' },
    { field: 'mar' },
    { field: 'apr' },
    { field: 'may' },
    { field: 'jun' },
    { field: 'jul' },
    { field: 'aug' },
    { field: 'sep' },
    { field: 'oct' },
    { field: 'nov' },
    { field: 'dec' },
]);
    const defaultColDef = useMemo<ColDef>(() => { return {
    flex: 1,
    minWidth: 100,
} }, []);
    const popupParent = useMemo<HTMLElement | null>(() => { return document.body }, []);



const onFirstDataRendered = useCallback((params: FirstDataRenderedEvent)   =>{
    params.api.createRangeChart({
        chartContainer: document.querySelector('#myChart') as HTMLElement,
        cellRange: {
            rowStartIndex: 0,
            rowEndIndex: 79,
            columns: ['year', 'jan', 'feb', 'mar', 'apr', 'may', 'jun', 'jul', 'aug', 'sep', 'oct', 'nov', 'dec'],
        },
        chartType: 'line',
        aggFunc: 'sum',
        switchCategorySeries: true,
    });
}, [])

    return  (
            <div style={containerStyle}>
                <div className="wrapper">

        <div  style={gridStyle} className={/** DARK MODE START **/document.documentElement?.dataset.defaultTheme || 'ag-theme-quartz'/** DARK MODE END **/}>
            <AgGridReact

                rowData={rowData}
columnDefs={columnDefs}
defaultColDef={defaultColDef}
enableRangeSelection={true}
popupParent={popupParent}
enableCharts={true}
onFirstDataRendered={onFirstDataRendered}
            />
        </div>
    <div id="myChart" className="ag-theme-quartz my-chart"></div>
</div>

            </div>
        );

}

const root = createRoot(document.getElementById('root')!);
root.render(<StrictMode><GridExample /></StrictMode>);

